multipletest_sym() {
	symimpl=$1
	stream=$2
	aiofallback=$3

	if [ x"$stream" = x"X" ]
	then
		stream=""
	fi

	if [ x"$aiofallback" = x"X" ]
	then
		aiofallback=""
	fi

	sout="one shot"
	impl_type="synchronous"
	if [ x"$stream" = x"-s" ]
	then
		sout="stream"
	fi
	if [ x"$stream" = x"-v" ]
	then
		sout="vmsplice"
	fi
	if [ $symimpl -eq 9 ]
	then
		impl_type="asynchronous"
	fi
	if [ -n "$aiofallback" ]
	then
		impl_type="$impl_type (AIO fallback)"
	fi

	cmd="$KCAPI $stream -d 2 -x $symimpl $aiofallback -e -c cbc(aes) -k 8d7dd9b0170ce0b5f2f8e1aa768e01e91da8bfc67fd486d081b28254c99eb423 -i 7fbc02ebf5b93322329df9bfccb635af -p 48981da18e4bb9ef7e2e3162d16b1910"
	result=$($cmd 2>/dev/null)
	if [ $symimpl -eq 9 ]
	then
		#This test results in an undefined behavior as it is not
		#defined by the kernel crypto API. Yet, only one of these
		#two results are allowed to be returned.
		expected="8b19050f66582cb7f7e4b6c873819b7108afa0eaa7de29bac7d903576b674c32"
		expected2="8b19050f66582cb7f7e4b6c873819b718b19050f66582cb7f7e4b6c873819b71"
	elif [ x"$stream" = x"-s" ]
	then
		#block chaining
		expected="8b19050f66582cb7f7e4b6c873819b71
08afa0eaa7de29bac7d903576b674c32"
	else
		expected="8b19050f66582cb7f7e4b6c873819b71
8b19050f66582cb7f7e4b6c873819b71"
	fi
	if [ x"$expected" = x"$result" -o x"$expected2" = x"$result" ]
	then
		echo_pass "Symmetric $impl_type cipher $sout multiple test"
	else
		echo_fail "Symmetric $impl_type cipher $sout multiple test"
		echo "($cmd)"
		echo "Exp $expected"
		echo "Got $result"
		failures=$(($failures+1))
	fi
}

